import React from 'react'; 
import './Header.css';
import Home from '../../Pages/Home/Home';
import ContactUs from '../../Pages/ContactUs/ContactUs';
import { Route, Switch } from 'react-router-dom';

class Header extends React.Component{
    render()
    {
   
     return (  
     <div id="header">
         
        <div id="headText">
            <img id="imgLogo" src="pic/logo3.png" />
        </div>

        <>            
          <Switch> 
            <Route exact path='/' component={Home}/>                
            <Route path='./Component/Pages/ContactUs/ContactUs' component={ContactUs}/>                       
          </Switch>
        </>


        {/* <nav className="navbar navbar-expand-sm bg-dark navbar-dark align-bottom" id="toolsty">
            <ul className="navbar-nav">
                <li className="nav-item">
                    <a className="nav-link" href="FinalHome.html">ראשי</a>
                </li>

                <li className="nav-item">
                    <a className="nav-link" href="Aboutus.html">אודות</a>
                </li>

                <li className="nav-item">
                    <a className="nav-link" href="contactus.html">צור קשר</a>
                </li>

                <li className="nav-item">
                    <a className="nav-link" href="#">התחברות</a>
                </li>
            </ul>

        </nav> */}
    

    </div>
     );
    }
}

export default Header
